import React, { useEffect, useState } from 'react';
import axios from "axios";

const Result = () => {

    const [document,setDocument]=useState([]);
    console.log("test");
    useEffect(()=>{
        axios.get("kar/auteur").then((res)=>setDocument(res.data))
     
    },[])

    return (
        <div className="Result" align="center">
            <h1> Liste des resultat</h1>
            <div className="container">
                <div className="row">
                    <div className="col-2">
                    FILTRE
                    </div>
                    <div className="col-8">
                    Column
                    </div>

                </div>
                </div>
             </div>
    );
};

export default Result;
